'use strict';
({ params, imports }) => {
  const programEnrolment = params.entity;
  const formElement = params.formElement;

  // --- Calculate Absolute Neutrophil Count (ANC) ---
  let wbcObs = programEnrolment.findObservation('WBC count during diagnosis');
  let neutrophilObs = programEnrolment.findObservation('SCD DC Neutrophil');

  let wbc = wbcObs && wbcObs.getValue();
  let neutrophil = neutrophilObs && neutrophilObs.getValue();

  console.log('WBC count', wbc);
  console.log('Neutrophil %', neutrophil);

  let value = null;
  if (_.isFinite(wbc) && _.isFinite(neutrophil)) {
    value = Math.round((wbc * neutrophil) / 100);
  }

  // --- Determine visibility based on enrolment answer ---
  const statusBuilder = new imports.rulesConfig.FormElementStatusBuilder({ programEnrolment, formElement });
  statusBuilder.show().when.valueInEnrolment('New patient SC').containsAnswerConceptName("Yes");

  // Build status with visibility and calculated value
  const status = statusBuilder.build();
  status.value = value; // Assign calculated ANC to the FormElementStatus value

  return status;
};

