//SAMPLE RULE EXAMPLE
"use strict";
({ params, imports }) => {
  const programEnrolment = params.entity;
  const scheduleBuilder = new imports.rulesConfig.VisitScheduleBuilder({
    programEnrolment
  });
  //add new visit schedule object to scheduleBuilder
  scheduleBuilder
    .add({
      name: "Sickle Cell followup",
      encounterType: "Sickle Cell followup",
      earliestDate: programEnrolment.enrolmentDateTime,
      maxDate: imports.moment(programEnrolment.enrolmentDateTime).add(20, 'days').toDate()
    });

  return scheduleBuilder.getAll();
};
